import React, { Component } from 'react';
import App from './App';

class Signup extends Component {
    render() { 
        return (
            <React.Fragment>
                <App active="signup"/>
                <div style={{ display: "flex", justifyContent: "center", alignItems: "center"}}>
                    This is a Signup Page
                </div>
            </React.Fragment>
        );
    }
}
 
export default Signup;
